import React, { Component } from 'react'
import Modal from '../HomeLogin/Modal'
export default class Navbar extends Component {
    constructor() {
        super()
        this.state = {
            isOpen: false
        }
    }
    showModal = () => {
        this.setState({ isOpen: true });
    };
    onClose = () => {
        this.setState({ isOpen: false });
    };
    render() {
        return (
            <div className="navbar">
                <div>Image here</div>
                <select className="options" onChange={this.props.changePage}>
                    <option value="user">User</option>
                    <option value="merchant">Merchant</option>
                </select>

                <button type="button" onClick={this.showModal} >Sign Up 2</button>
                <RegisterModal  open={this.state.isOpen} onClose={this.onClose} onClick={this.props.onClickSignUp} onRegistered={this.props.onRegistered} />

                <button type="button" onClick={this.showModal} >Login</button>
                <LoginModal  open={this.state.isOpen} onClose={this.onClose} onClick={this.props.onClickLogin} onLogin={this.onLogin} />

            <div className="login break" onClick={this.props.onClickSignUp}>Sign up</div>
            <div className="login" onClick={this.props.onClickLogin}>Login</div>
            </div>
            )
    }
}
